import React from "react";
import "./Gobackbtn.css";

const Gobackbtn = props => {
  return (
    <div>
      <input
        type="button"
        value="Go Back From Where You Came!"
        onclick="history.back(-1)"
      />
    </div>
  );
};

export default Gobackbtn;
